import React from 'react';

const FlagLt = props => (
  <svg viewBox="0 0 5 3" {...props}>
    <path fill="#C1272D" d="M0 0h5v3H0z" />
    <path fill="#006A44" d="M0 0h5v2H0z" />
    <path fill="#FDB913" d="M0 0h5v1H0z" />
  </svg>
);

export default FlagLt;
